import React, { Suspense } from "react";
import { GET_PAGE_FIELDS } from "../apollo/queries";
import { useParams } from "react-router-dom";
import { useQuery } from "@apollo/client";


const Page = () => {
  const { slug } = useParams();
  const currentSlug = slug || "home";

  const { loading, error, data } = useQuery(GET_PAGE_FIELDS, {
    variables: { slug: currentSlug },
  });

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error loading page: {error.message}</div>;
  const page = data.pageBy.content;
  const content = data?.pageBy?.content
  console.log(content);

  if (!content) {
    return <div>Comming soon..</div>;
  }

  let TemplateComponent;

  // Determine which template to use
  switch (content?.contentSection) {
    case "ContentContentSectionHeaderVideoLayout":
      TemplateComponent = React.lazy(() => import("../components/template-parts/VideoHeader"));
      TemplateComponent = (
                <VideoHeader
                  title={content?.contentSection?.title || ""}
                  buttonsa={videoHeaderData?.buttons || []}
                  text={videoHeaderData?.text || ""}
                  videourl={videoHeaderData?.video?.node?.mediaItemUrl || ""}
                  imageintop={
                    videoHeaderData?.imageBeforeTitle?.node?.mediaItemUrl || ""
                  }
                />
              );
      break;
    case "About":
      TemplateComponent = React.lazy(() => import("../templates/AboutTemplate"));
      break;
    case "Contact":
      TemplateComponent = React.lazy(() => import("../templates/ContactTemplate"));
      break;
      case "Default":
        TemplateComponent = React.lazy(() => import("../templates/DefaultTemplate"));
        break;
    default:
      TemplateComponent = () => <div dangerouslySetInnerHTML={{ __html: page.content }} />;
  }

  return (
    <div>
      <Suspense fallback={<div>Loading template...</div>}>
        <TemplateComponent />
      </Suspense>
    </div>
  );
};

export default Page;
